import React from 'react'
import LineItem from './LineItem';

const ItemsList = ({items,handleCheck,handleDelete}) => {
    return(
    // <ul>
    //     {items.map((item) => (
    //         <LineItem
    //             item = {item}
    //             handleCheck = {handleCheck}
    //             handleDelete = {handleDelete}
    //         />
    //     ))}
    // <ul />
    <ul>
        {items.map((item) => (
            <LineItem 
            item = {item}
            
            handleCheck = {handleCheck}
            />
        ))}
    </ul>
    )
}

export default ItemsList
